const blue = "#5897c9";

function topRightTable(report) {
    return {
        width:"*",
        
        table: {
            widths: ['*', 'auto'],
            body: [
                [{text:'NCR No.', fillColor:"#5897c9"}, report.ncrNumber],
                [{text:'PROD No.', fillColor:"#5897c9"}, report.prodNumber],
                [{text:'Sales Order No.', fillColor:"#5897c9"}, report.salesNumber],
                [{text:'Quantity Received', fillColor:"#5897c9"}, report.qtyReceived],
                [{text:'Quantity Defective', fillColor:"#5897c9"}, report.qtyDefective],
                [{text: "Supplier Name", fillColor: "#5897c9"}, `${report.supplierName}`]
            ], margin: [0, 0, 20, 0]
        }
    }
}

function qaFooter(report){

    return [
        {text:"\nQuality Representative's Name: " + "Bob Taylor"},
        {text:"Date " + report.date},
    
    ]
}



    function qaHeader(report){
    return [
        {text:"Quality Assurance\n", style:"header", fontSize:16, margin:[0, 0, 0, 5], color:blue},
        {

            columns:[

                { width:200, table:{body:[
                    [{text:"Identify Process Applicable\n", style:"header", fontSize:14, fillColor:blue}, ""],
                            ["Supplier or Rec-Insp", report.supplierOrRec ? checkBox() : ""],
                            ["WIP (Production Order)", /*report.productionOrder ? checkBox() :*/ ""] // TODO Change
                        ]}},
                topRightTable(report)
                //{table: {body: [[{text: "Supplier Name"}, ""], [`${report.supplierName}`, ""]]}}
            ]
        }
    ]
}

    export function convertToPDF(reportNumber) {
        let report = getReport(reportNumber);
        let pdf = {
            content: [
                logo(),
                ...qaHeader(report),
                qaDescriptions(report),
                ...qaFooter(report),
                ...engHeader(report),
                ...engDisposition(report),
                ...engFooter(report)
            ]
        }
        return pdf;

}
/* ENGINEERING */

function engHeader(report){
    return [{canvas: [ { type: 'line', x1: 0, y1: 0, x2: 515, y2: 0, lineWidth: 1 } ], margin:[0, 5, 0, 40]},
        {text:"Review By Engineering", style:"header", fontSize:16, color:blue},
        {text:"Return to Supplier for either rework or replacement?",},
        {columns:[
                {table:{body:[
                            [{text:"Use As-Is",fillColor:blue}, report.supplierOrRec ? checkBox() : ""]
                        ]}},
                {table:{body:[
                            [{text:"Repair",fillColor:blue}, false ? checkBox() : ""]
                        ]}},
                {table:{body:[
                            [{text:"Rework",fillColor:blue}, false ? checkBox() : ""]
                        ]}},
                {table:{body:[
                            [{text:"Scrap",fillColor:blue}, false ? checkBox() : ""]
                        ]}}
            ], margin:[0, 5, 0, 0]}
    ]
}


function engDisposition(report){
    return [
        {text:"Disposition", style:"header", fontSize:14, margin:[0, 10, 0, 0], color:blue},
        {text:report.disposition || engTemp.disposition},
        {canvas: [ { type: 'line', x1: 0, y1: 0, x2: 515, y2: 0, lineWidth: 1 } ], margin:[0, 5, 0, 25]},
        {table:{body:[
                    ["Does the Drawing Require Updating", report.supplierOrRec ? checkBox() : ""],
                    ["Original Rev. Number", report.originalRevNo || engTemp.originalRevNo],
                    ["Updated Rev. Number", report.updatedRevNo || engTemp.updatedRevNo],
                    ["Revision Date", report.date]
                ], margin: [0, 0, 40, 0]}}
    ]
}

function engFooter(report){
    return [

                {text:"\nName of Engineer: " + "Bob Taylor"},
                {text:"Date " + report.date}
            ]

}

